import React, { Fragment } from 'react'
import PropTypes from 'prop-types'
import SummaryMeals from './SummaryMeals'

const Meals = props => {
  return (
    <Fragment>
      <SummaryMeals/>
    </Fragment>
  )
}

Meals.propTypes = {}

export default Meals
